import{_ as a,c as n,o as e,a4 as t}from"./chunks/framework.Dx5AVRXu.js";const _=JSON.parse('{"title":"fnOS 常见问题解答","description":"","frontmatter":{},"headers":[],"relativePath":"fnos/question.md","filePath":"fnos/question.md","lastUpdated":1725090426000}'),o={name:"fnos/question.md"},r=t('<h1 id="fnos-常见问题解答" tabindex="-1">fnOS 常见问题解答 <a class="header-anchor" href="#fnos-常见问题解答" aria-label="Permalink to &quot;fnOS 常见问题解答&quot;">​</a></h1><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/Snipaste_2024-08-31_14-51-40_EuryBP.jpg" alt="Snipaste_2024-08-31_14-51-40_EuryBP"></p><h2 id="fnos-系统是付费的吗" tabindex="-1">fnOS 系统是付费的吗？ <a class="header-anchor" href="#fnos-系统是付费的吗" aria-label="Permalink to &quot;fnOS 系统是付费的吗？&quot;">​</a></h2><p>国内用户免费使用，具体信息可以看 <a href="https://help.fnnas.com/articles/fnosV1/contact/profit-statement.md" target="_blank" rel="noreferrer">官网公告</a>。</p><h2 id="如何在虚拟机上安装体验-fnos" tabindex="-1">如何在虚拟机上安装体验 fnOS？ <a class="header-anchor" href="#如何在虚拟机上安装体验-fnos" aria-label="Permalink to &quot;如何在虚拟机上安装体验 fnOS？&quot;">​</a></h2><ul><li><a href="/unraid/fnos.html">Unraid 虚拟 fnOS</a></li><li><a href="/synology/fnos.html">群晖虚拟 fnOS</a></li><li>PVE、ESXi 虚拟 fnOS 可以参考 <a href="https://help.fnnas.com/articles/fnosV1/start/install-virtual.md" target="_blank" rel="noreferrer">官方教程</a>。</li></ul><h2 id="fnos-系统安装在哪里" tabindex="-1">fnOS 系统安装在哪里？ <a class="header-anchor" href="#fnos-系统安装在哪里" aria-label="Permalink to &quot;fnOS 系统安装在哪里？&quot;">​</a></h2><p>fnOS 推荐安装在 SSD 硬盘上，如果是 128G 的 SSD 硬盘，系统只会占用大约 60~70G 的空间。实测使用 16G 的傲腾 M10 SSD 也可以顺利安装，系统也可以正常升级。</p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/ZsCnwY_pxBpNX.png" alt="ZsCnwY_pxBpNX"></p><h2 id="fnos-支持-docker-和虚拟机吗" tabindex="-1">fnOS 支持 Docker 和虚拟机吗？ <a class="header-anchor" href="#fnos-支持-docker-和虚拟机吗" aria-label="Permalink to &quot;fnOS 支持 Docker 和虚拟机吗？&quot;">​</a></h2><p>目前公测版支持 Docker，暂不支持虚拟机功能，后续版本会支持。</p><h2 id="fnos-开关机很快吗" tabindex="-1">fnOS 开关机很快吗？ <a class="header-anchor" href="#fnos-开关机很快吗" aria-label="Permalink to &quot;fnOS 开关机很快吗？&quot;">​</a></h2><p>快！非常快！实测系统装在 SSD 上，开机只需要不超过 20s，关机只需要大约 8s。</p><h2 id="fnos-支持硬盘休眠吗" tabindex="-1">fnOS 支持硬盘休眠吗？ <a class="header-anchor" href="#fnos-支持硬盘休眠吗" aria-label="Permalink to &quot;fnOS 支持硬盘休眠吗？&quot;">​</a></h2><p>支持。</p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/sipi22us.jph_7A6HOa.png" alt="sipi22us.jph_7A6HOa"></p><h2 id="fnos-的兼容性怎么样" tabindex="-1">fnOS 的兼容性怎么样？ <a class="header-anchor" href="#fnos-的兼容性怎么样" aria-label="Permalink to &quot;fnOS 的兼容性怎么样？&quot;">​</a></h2><p>fnOS 基于 Debian 开发，兼容性很好。实测在华擎 N3150 这种较老主板，以及倍控 N100 这种比较新的主板都可以正常安装运行，而且非常流畅，多个网口也可以正常识别。</p><p><img src="https://img-1255332810.cos.ap-chengdu.myqcloud.com/9WrxAt_C7CzDr.png" alt="9WrxAt_C7CzDr"></p>',19),s=[r];function i(l,f,c,h,p,d){return e(),n("div",null,s)}const m=a(o,[["render",i]]);export{_ as __pageData,m as default};
